  false,\n\t\"url\": null,\n\t\"notes\": \"In 1984, the U.S. Geological Survey (USGS),
  Office of Marine Geology, launched a program using the Geological LOng-Range Inclined
  Asdic (GLORIA) sidescan-sonar system to study the entire U.S. Exclusive Economic
  Zone (EEZ). From 1989 through 1991, the USGS and IOS (Institute of Oceanographic
  Sciences, U.K.) scientists conducted several surveys within the EEZ off Hawaii.
  Six surveys during that time period focused on the northwestern Hawaii region. The
  results of these surveys were 22 digital mosaics of approximately of approximately
  a 2 degree by 2 degree area with a 50-meter pixel resolution.\",\n\t\"license_title\":
